import React, { useState } from "react";
import FormDataForm from "./generalform";

const Applications = () => {
    const [dataUpdated, setDataUpdated] = useState(false);

    const handleDataUpdate = () => {
        setDataUpdated(!dataUpdated);
    };
    return (
        <div>
            <div>
                <Table
                    apiUrl="http://localhost:8080/advertisement/monitor"
                    itemName="Advertisements"
                    itemKeys={[
                        "id",
                        "advertisementid",
                        "companyid",
                        "email",
                        "firstname",
                        "lastname",
                    ]}
                    customColumns={[
                        "id",
                        "Advertisement id",
                        "Company id",
                        "Email",
                        "First name",
                        "Last name",
                    ]}
                />
            </div>
            <div>
                <FormDataForm
                    apiUrl={"http://localhost:8080/advertisement"}
                    formFields={[
                        {
                            name: "advertismentid",
                            label: "Advertisementid",
                            type: "number",
                        },
                        {
                            name: "companyid",
                            label: "Company id",
                            type: "number",
                        },
                        {
                            name: "email",
                            label: "Email",
                            type: "email",
                        },
                        {
                            name: "firstname",
                            label: "First name",
                            type: "text",
                        },
                        {
                            name: "lastname",
                            label: "Last name",
                            type: "text",
                        },
                    ]}
                />
            </div>
        </div>
    );
};

export default Applications;
